<!doctype html>
<html>
<head>
<style>
	#middle {
		animation: spinning 3s infinite linear
	}
	@keyframes spinning {
		0% {
			transform: rotate(0deg);
			transform-origin: 49% 39%;
		}
		100% {
			transform: rotate(-360deg);
			transform-origin: 49% 39%;
		}
	}
	
	#petals {
		animation: spinningcw 3s infinite linear
	}
	@keyframes spinningcw {
		0% {
			transform: rotate(0deg);
			transform-origin: 49% 39%;
		}
		100% {
			transform: rotate(360deg);
			transform-origin: 49% 39%;
		}
	}
	#clouds {
		animation: fade 8s infinite linear
	}
	@keyframes fade {
		0% {
			opacity: 0%;
		}
		50% {
			opacity: 100%;
		}
		100% {
			opacity: 0%;
		}
	}
	#grass {
		animation: wind 8s infinite linear
	}
	@keyframes wind {
		0% {
			transform: translateX(-15px);
		}
		50% {
			transform: translateX(15px);
		}
		100% {
			transform: translateX(-15px);
		}
	}
	#sky {
		animation: breeze 8s infinite linear
	}
	@keyframes breeze {
		0% {
			transform: translateX(-15px);
		}
		50% {
			transform: translateX(15px);
		}
		100% {
			transform: translateX(-15px);
		}
	}
	}
</style>
